    <div class="game-container">
        <div class="game-card">
            <!-- Settings Panel -->
            <div class="settings-panel" id="settingsPanel">
                <div class="settings-header">
                    <h3>Game Settings</h3>
                    <button class="close-settings" id="closeSettings"></button>
                </div>
                
                <!-- Game Mode Selection -->
                <div class="setting-group">
                    <label>Game Mode</label>
                    <div class="mode-buttons">
                        <button class="mode-btn active" data-mode="pvp">Player vs Player</button>
                        <button class="mode-btn" data-mode="ai">Player vs AI</button>
                    </div>
                </div>

                <!-- AI Difficulty -->
                <div class="setting-group ai-only hidden">
                    <label>AI Difficulty</label>
                    <div class="difficulty-buttons">
                        <button class="difficulty-btn" data-difficulty="easy">Easy</button>
                        <button class="difficulty-btn active" data-difficulty="medium">Medium</button>
                        <button class="difficulty-btn" data-difficulty="hard">Hard</button>
                    </div>
                </div>

                <!-- Theme Selection -->
                <div class="setting-group">
                    <label>Theme</label>
                    <div class="theme-buttons">
                        <button class="theme-btn active" data-theme="default">Classic</button>
                        <button class="theme-btn" data-theme="dark">Dark</button>
                        <button class="theme-btn" data-theme="neon">Neon</button>
                        <button class="theme-btn" data-theme="nature">Nature</button>
                    </div>
                </div>

                <!-- Sound Settings -->
                <div class="setting-group">
                    <label>Sound Effects</label>
                    <div class="sound-controls">
                        <button class="sound-toggle active" id="soundToggle">
                            <span class="sound-icon"></span>
                            <span class="sound-text">ON</span>
                        </button>
                        <div class="volume-control">
                            <input type="range" id="volumeSlider" min="0" max="100" value="50">
                            <span id="volumeValue">50%</span>
                        </div>
                    </div>
                </div>

                <!-- Background Music -->
                <div class="setting-group">
                    <label>Background Music</label>
                    <button class="music-toggle" id="musicToggle">
                        <span class="music-icon"></span>
                        <span class="music-text">OFF</span>
                    </button>
                </div>
            </div>

            <!-- Header -->
            <div class="header">
                <div class="title-section">
                    <div class="icon-wrapper">
                        <svg class="game-icon" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
                            <path d="M16 21v-2a4 4 0 0 0-4-4H6a4 4 0 0 0-4 4v2"/>
                            <circle cx="9" cy="7" r="4"/>
                            <path d="M22 21v-2a4 4 0 0 0-3-3.87"/>
                            <path d="M16 3.13a4 4 0 0 1 0 7.75"/>
                        </svg>
                    </div>
                    <h1 class="game-title">Tic-Tac-Toe</h1>
                    <button class="settings-btn" id="settingsBtn">
                        <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
                            <circle cx="12" cy="12" r="3"/>
                            <path d="M12 1v6m0 6v6m11-7h-6m-6 0H1"/>
                        </svg>
                    </button>
                </div>
                
                <!-- Game Status -->
                <div class="game-status" id="gameStatus">
                    <div class="status-content">
                        <span id="statusText">Player X's Turn</span>
                    </div>
                </div>

                <!-- Score Display -->
                <div class="score-display">
                    <div class="score-item">
                        <span class="score-label">Player X</span>
                        <span class="score-value" id="scoreX">0</span>
                    </div>
                    <div class="score-item">
                        <span class="score-label">Draws</span>
                        <span class="score-value" id="scoreDraw">0</span>
                    </div>
                    <div class="score-item">
                        <span class="score-label" id="playerOLabel">Player O</span>
                        <span class="score-value" id="scoreO">0</span>
                    </div>
                </div>
            </div>

            <!-- Game Board -->
            <div class="board-container">
                <div class="game-board" id="gameBoard">
                    <div class="square" data-index="0"></div>
                    <div class="square" data-index="1"></div>
                    <div class="square" data-index="2"></div>
                    <div class="square" data-index="3"></div>
                    <div class="square" data-index="4"></div>
                    <div class="square" data-index="5"></div>
                    <div class="square" data-index="6"></div>
                    <div class="square" data-index="7"></div>
                    <div class="square" data-index="8"></div>
                </div>
            </div>

            <!-- Game Controls -->
            <div class="controls">
                <div class="control-buttons">
                    <button class="control-btn new-game-btn" id="newGameBtn">
                        <svg class="btn-icon" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
                            <path d="M3 12a9 9 0 0 1 9-9 9.75 9.75 0 0 1 6.74 2.74L21 8"/>
                            <path d="M21 3v5h-5"/>
                            <path d="M21 12a9 9 0 0 1-9 9 9.75 9.75 0 0 1-6.74-2.74L3 16"/>
                            <path d="M3 21v-5h5"/>
                        </svg>
                        New Game
                    </button>

                    <button class="control-btn reset-score-btn" id="resetScoreBtn">
                        <svg class="btn-icon" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
                            <path d="M3 6h18"/>
                            <path d="M19 6v14c0 1-1 2-2 2H7c-1 0-2-1-2-2V6"/>
                            <path d="M8 6V4c0-1 1-2 2-2h4c1 0 2 1 2 2v2"/>
                        </svg>
                        Reset Score
                    </button>
                </div>

                <!-- Player Indicators -->
                <div class="player-indicators">
                    <div class="player-indicator player-x active" id="playerX">
                        <div class="player-dot"></div>
                        <span class="player-label">Player X</span>
                    </div>
                    <div class="player-indicator player-o" id="playerO">
                        <div class="player-dot"></div>
                        <span class="player-label" id="playerOIndicator">Player O</span>
                    </div>
                </div>
            </div>

            <!-- Winner Celebration -->
            <div class="celebration hidden" id="celebration">
                <div class="celebration-content">
                    <div class="celebration-emoji"></div>
                    <p class="celebration-text" id="celebrationText">
                        Congratulations Player X!
                    </p>
                </div>
            </div>

            <!-- Draw Message -->
            <div class="draw-message hidden" id="drawMessage">
                <div class="draw-content">
                    <div class="draw-emoji"></div>
                    <p class="draw-text">
                        Great game! It's a tie!
                    </p>
                </div>
            </div>

            <!-- AI Thinking Indicator -->
            <div class="ai-thinking hidden" id="aiThinking">
                <div class="thinking-content">
                    <div class="thinking-dots">
                        <span></span>
                        <span></span>
                        <span></span>
                    </div>
                    <p>AI is thinking...</p>
                </div>
            </div>
        </div>
    </div>

    <script src="script.js"></script>
</body>
</html>
